import React from "react";
import Cal from "./cal";
import "./App.css"

var inputstr = "";

function inputc(inputChar){
  inputstr += inputChar;
}

class App extends React.Component {

  render() {
    return(
      <div id="calculator">
        <div id="display">
          <div id="answer">
            <Cal inputstr = {inputstr} id={1}/>
          </div>
        </div>
        <div id="calculatorBody">

        </div>
      </div>
    )
  };
}

export default App;
